import Clock from './component/clocker';
import Button from '@material-ui/core/Button';
import {useState} from 'react';

export default function ComfirmEmail() {
      const [email, setEmail] = useState('');
 
        async function onSub(e){
        e.preventDefault();
         setEmail(sessionStorage.getItem('emailValidator'))
        
 }

return (
  <form onSubmit={onSub}>
      <h2 className='subtitle'>Quase lá,
       por Favor, confirme seu e-mail para
       enviarmos as instruções de validação.
      O link para validação será enviado para: {`${email}`}</h2>
      <Clock/>
      <Button type="submit">Enviar</Button>
    </form>
);
}
